import React from "react";

const Skills = () => {
  return(
    <div className=" main__wrapper info">
      <h1 className="info__title">Skills</h1>
      <div className="info__section">
        <h2 className="info__subtitle">Frontend</h2>
        <p>Ruby on Rails, Hotwire, JavaScript, HTML, TailwindCSS, CSS, ReactJS</p>
      </div>

      <div className="info__section">
        <h2 className="info__subtitle">Backend</h2>
        <p>Ruby, text, text, text, text</p>
      </div>
    </div>
  )
}

export default Skills;
